import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <nav id="navigation">
        <div id="logoNav">
        </div>
        <div id="websiteName">
          <h1><NavLink to={'/'}>Viddev</NavLink></h1>
        </div>
        <div id="linksNav">
            <ul>
                <li><NavLink to={'/tvshows'}>TV Shows</NavLink></li>
                <li><NavLink to={'/movies'}>Movie</NavLink></li>
                <li><NavLink to={'/contact'}>Contact Us</NavLink></li>
                <li id='headerLoginBtn'>Login</li>
                <div id="headerModalLogin" className="displayNone">
                  <h2>Test</h2>
                  <span id="closeSpan">close</span>
                </div>
                <li><NavLink to={'/registrer'}>Registrer</NavLink></li>
            </ul>
        </div>
      </nav>
    </header>
  );
};

function showModal(){
  let btn = document.getElementById('headerLoginBtn');
  let modal = document.getElementById('headerModalLogin');

  btn.addEventListener('click', showModal);

  modal.classList.remove('displayNone');
}

showModal();
export default Header;
